import EvenementBrouillon from '../ProfileOrganisateur/EvenementBrouillon/EvenementBrouillon';

function EvenementsValides() {
  return (
    <>
      <HeroSectionProfile/>
      <BarProfileEvenement2/>
      <EvenementBrouillon/>
    </>
  );
}

export default EvenementsValides;
